INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 70, 1, "アヤネ", 102301, 0, 12, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 71, 2, "アヤネ", 102301, 0, 12, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 72, 1, "チカ", 104201, 0, 12, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("私のことを見守ってください\nできることなら、ずっと…", 73, 2, "チカ", 104201, 0, 12, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 74, 1, "クルミ", 102101, 0, 12, 2, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("で、でもこれからもずっと…\n一緒にいたいなぁ…", 75, 2, "クルミ", 102101, 0, 12, 2, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 76, 1, "シズル", 104901, 0, 13, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 77, 2, "シズル", 104901, 0, 13, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 78, 1, "リノ", 101101, 0, 13, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 79, 2, "リノ", 101101, 0, 13, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 80, 1, "ユイ", 100201, 0, 14, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 81, 2, "ユイ", 100201, 0, 14, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("騎士くんと出会って、まだ1年しか\nたってないんだ！？", 82, 1, "ヒヨリ", 100101, 0, 14, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 83, 2, "ヒヨリ", 100101, 0, 14, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 84, 1, "レイ", 100301, 0, 14, 2, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キミに背中を預けられる日が、\n早くきますように", 85, 2, "レイ", 100301, 0, 14, 2, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 86, 1, "ペコリーヌ", 105801, 0, 15, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("これからもずっと、覚えていて\nくださいね！", 87, 2, "ペコリーヌ", 105801, 0, 15, 0, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 88, 1, "コッコロ", 105901, 0, 15, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 89, 2, "コッコロ", 105901, 0, 15, 1, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 90, 1, "キャル", 106001, 0, 15, 2, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 91, 2, "キャル", 106001, 0, 15, 2, 80001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 92, 1, "スズメ", 112101, 1, 0, 1, 60001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 93, 0, "", 0, 1, 0, 2, 60001, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 94, 0, "", 0, 1, 0, 2, 60001, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 95, 0, "", 0, 1, 0, 2, 60001, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 96, 0, "", 0, 1, 0, 2, 60001, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 97, 0, "", 0, 2, 0, 2, 60001, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 98, 0, "", 0, 1, 0, 2, 60001, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 99, 0, "", 0, 1, 0, 2, 60001, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 100, 0, "", 0, 1, 0, 2, 60001, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 101, 0, "", 0, 1, 0, 2, 60001, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 102, 0, "", 0, 2, 0, 2, 60001, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 103, 0, "", 0, 1, 0, 2, 60001, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 104, 0, "", 0, 1, 0, 2, 60001, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 105, 0, "", 0, 1, 0, 2, 60001, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 106, 0, "", 0, 1, 0, 2, 60001, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 107, 0, "", 0, 1, 0, 2, 60001, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 108, 0, "", 0, 1, 0, 2, 60001, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 109, 0, "", 0, 2, 0, 2, 60001, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 110, 0, "", 0, 1, 0, 2, 60001, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 111, 0, "", 0, 1, 0, 2, 60001, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 112, 0, "", 0, 1, 0, 2, 60001, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 113, 0, "", 0, 1, 0, 2, 60001, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 114, 0, "", 0, 1, 0, 2, 60001, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 115, 0, "", 0, 1, 0, 2, 60001, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 116, 0, "", 0, 2, 0, 2, 60001, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 117, 2, "スズメ", 112101, 0, 0, 3, 60001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 118, 3, "スズメ", 112101, 0, 7, 3, 60001, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ヒューヒュー♪\nドンドンパフパフー♪", 119, 1, "ペコリーヌ", 105801, 0, 1, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ひゅーひゅー\nどんどんぱふぱふー\nでございます", 120, 1, "コッコロ", 105901, 0, 1, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 121, 2, "コッコロ", 105901, 0, 1, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("え？　ちょっと\nいきなりなにっ？", 122, 1, "キャル", 106001, 0, 1, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 123, 2, "キャル", 106001, 0, 1, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 124, 2, "ペコリーヌ", 105801, 0, 1, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 125, 3, "ペコリーヌ", 105801, 0, 1, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", 126, 3, "コッコロ", 105901, 0, 1, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 127, 3, "キャル", 106001, 0, 1, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 128, 4, "コッコロ", 105901, 0, 1, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 129, 4, "ペコリーヌ", 105801, 0, 1, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 130, 4, "キャル", 106001, 0, 1, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 131, 5, "コッコロ", 105901, 0, 1, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 132, 5, "キャル", 106001, 0, 2, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 133, 1, "カリン", 190801, 0, 2, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", 134, 6, "キャル", 106001, 0, 2, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 135, 2, "カリン", 190801, 0, 2, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 136, 7, "キャル", 106001, 0, 2, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 137, 3, "カリン", 190801, 0, 2, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 138, 8, "キャル", 106001, 0, 2, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 139, 9, "キャル", 106001, 0, 2, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 140, 4, "カリン", 190801, 0, 2, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 141, 10, "キャル", 106001, 0, 2, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 142, 5, "カリン", 190801, 0, 2, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 143, 11, "キャル", 106001, 0, 2, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 144, 6, "コッコロ", 105901, 0, 3, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 145, 5, "ペコリーヌ", 105801, 0, 3, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 146, 7, "コッコロ", 105901, 0, 3, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 147, 8, "コッコロ", 105901, 0, 3, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 148, 6, "ペコリーヌ", 105801, 0, 3, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 149, 7, "ペコリーヌ", 105801, 0, 3, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", 150, 9, "コッコロ", 105901, 0, 3, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 151, 8, "ペコリーヌ", 105801, 0, 3, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 152, 10, "コッコロ", 105901, 0, 3, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", 153, 9, "ペコリーヌ", 105801, 0, 3, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 154, 11, "コッコロ", 105901, 0, 3, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 155, 10, "ペコリーヌ", 105801, 0, 3, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 156, 11, "ペコリーヌ", 105801, 0, 4, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 157, 12, "キャル", 106001, 0, 4, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 158, 12, "ペコリーヌ", 105801, 0, 4, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 159, 13, "キャル", 106001, 0, 4, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 160, 13, "ペコリーヌ", 105801, 0, 4, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…積極的？\nなんの話よ？", 161, 14, "キャル", 106001, 0, 4, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 162, 14, "ペコリーヌ", 105801, 0, 4, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", 163, 15, "ペコリーヌ", 105801, 0, 4, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 164, 15, "キャル", 106001, 0, 4, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 165, 16, "ペコリーヌ", 105801, 0, 4, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 166, 16, "キャル", 106001, 0, 4, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 167, 17, "キャル", 106001, 0, 4, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 168, 18, "キャル", 106001, 0, 5, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 169, 12, "コッコロ", 105901, 0, 5, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 170, 19, "キャル", 106001, 0, 5, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 171, 13, "コッコロ", 105901, 0, 5, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 172, 20, "キャル", 106001, 0, 5, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 173, 14, "コッコロ", 105901, 0, 5, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 174, 21, "キャル", 106001, 0, 5, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 175, 15, "コッコロ", 105901, 0, 5, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("かくし芸？", 176, 22, "キャル", 106001, 0, 5, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 177, 16, "コッコロ", 105901, 0, 5, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 178, 23, "キャル", 106001, 0, 5, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 179, 17, "ペコリーヌ", 105801, 0, 6, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 180, 24, "キャル", 106001, 0, 6, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 181, 17, "コッコロ", 105901, 0, 6, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 182, 18, "ペコリーヌ", 105801, 0, 6, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 183, 25, "キャル", 106001, 0, 6, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 184, 18, "コッコロ", 105901, 0, 6, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 185, 26, "キャル", 106001, 0, 6, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 186, 27, "キャル", 106001, 0, 6, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 187, 28, "キャル", 106001, 0, 6, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 188, 19, "ペコリーヌ", 105801, 0, 6, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 189, 19, "コッコロ", 105901, 0, 6, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 190, 29, "キャル", 106001, 0, 6, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 191, 30, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 192, 31, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 193, 32, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", 194, 33, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 195, 34, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("オイッスー☆", 196, 35, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", 197, 36, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 198, 37, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", 199, 38, "キャル", 106001, 0, 7, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 200, 20, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 201, 21, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 202, 22, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 203, 23, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 204, 24, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("オイッスー☆", 205, 25, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 206, 26, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 207, 27, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 208, 28, "コッコロ", 105901, 0, 8, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("オイッスー☆", 209, 20, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 210, 21, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あと６日で2.5周年ですか…", 211, 22, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 212, 23, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 213, 24, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("オイッスー☆", 214, 25, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 215, 26, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 216, 27, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 217, 28, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 218, 29, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 219, 30, "ペコリーヌ", 105801, 0, 9, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 220, 31, "ペコリーヌ", 105801, 0, 10, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 221, 29, "コッコロ", 105901, 0, 10, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 222, 32, "ペコリーヌ", 105801, 0, 10, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…………", 223, 39, "キャル", 106001, 0, 10, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 224, 30, "コッコロ", 105901, 0, 10, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 225, 40, "キャル", 106001, 0, 10, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 226, 33, "ペコリーヌ", 105801, 0, 10, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 227, 41, "キャル", 106001, 0, 10, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 228, 34, "ペコリーヌ", 105801, 0, 10, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 229, 35, "ペコリーヌ", 105801, 0, 10, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 230, 42, "キャル", 106001, 0, 10, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 231, 31, "コッコロ", 105901, 0, 10, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 232, 43, "キャル", 106001, 0, 10, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 233, 36, "ペコリーヌ", 105801, 0, 10, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 234, 6, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 235, 7, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 236, 8, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 237, 9, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 238, 10, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", 239, 11, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 240, 12, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 241, 13, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あれ？\nもしかして緊張で気を失って…？", 242, 14, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 243, 15, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 244, 16, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それでは\nまた明日お会いしましょう♪", 245, 17, "カリン", 190801, 0, 11, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 246, 44, "キャル", 106001, 0, 12, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 247, 37, "ペコリーヌ", 105801, 0, 12, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 248, 32, "コッコロ", 105901, 0, 12, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 249, 45, "キャル", 106001, 0, 12, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ひどいですよぉキャルちゃ～ん！", 250, 38, "ペコリーヌ", 105801, 0, 12, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 251, 33, "コッコロ", 105901, 0, 12, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 252, 39, "ペコリーヌ", 105801, 0, 12, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 253, 46, "キャル", 106001, 0, 12, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 254, 34, "コッコロ", 105901, 0, 12, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 255, 40, "ペコリーヌ", 105801, 0, 12, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 256, 41, "ペコリーヌ", 105801, 0, 13, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 257, 47, "キャル", 106001, 0, 13, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("忘れてきちゃいました☆", 258, 42, "ペコリーヌ", 105801, 0, 13, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 259, 48, "キャル", 106001, 0, 13, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 260, 35, "コッコロ", 105901, 0, 13, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 261, 49, "キャル", 106001, 0, 13, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 262, 43, "ペコリーヌ", 105801, 0, 13, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 263, 50, "キャル", 106001, 0, 13, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 264, 36, "コッコロ", 105901, 0, 13, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 265, 51, "キャル", 106001, 0, 13, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 266, 37, "コッコロ", 105901, 0, 13, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 267, 52, "キャル", 106001, 0, 13, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 268, 44, "ペコリーヌ", 105801, 0, 13, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 269, 38, "コッコロ", 105901, 0, 13, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 270, 45, "ペコリーヌ", 105801, 0, 13, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 271, 53, "キャル", 106001, 0, 13, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 272, 46, "ペコリーヌ", 105801, 0, 13, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", 273, 18, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("昨日の生放送は\nいかがだったでしょうか？", 274, 19, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 275, 20, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 276, 21, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 277, 22, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 278, 23, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 279, 24, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 280, 25, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 281, 26, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 282, 27, "カリン", 190801, 0, 14, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("準備はいいですかっ？\n…いっきますよー！", 283, 47, "ペコリーヌ", 105801, 0, 15, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("祝！", 284, 54, "キャル", 106001, 0, 15, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("2.5周年！", 285, 39, "コッコロ", 105901, 0, 15, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おめでとうございま～す☆", 286, 48, "ペコリーヌ", 105801, 0, 15, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 287, 55, "キャル", 106001, 0, 15, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 288, 40, "コッコロ", 105901, 0, 15, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 289, 49, "ペコリーヌ", 105801, 0, 15, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 290, 56, "キャル", 106001, 0, 15, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 291, 41, "コッコロ", 105901, 0, 15, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 292, 57, "キャル", 106001, 0, 15, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 293, 50, "ペコリーヌ", 105801, 0, 15, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 294, 58, "キャル", 106001, 0, 15, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", 295, 51, "ペコリーヌ", 105801, 0, 15, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("意味分かんないわよ！", 296, 59, "キャル", 106001, 0, 15, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 297, 42, "コッコロ", 105901, 0, 15, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 298, 43, "コッコロ", 105901, 0, 15, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 299, 52, "ペコリーヌ", 105801, 0, 15, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 300, 60, "キャル", 106001, 0, 15, 2, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 301, 44, "コッコロ", 105901, 0, 15, 1, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 302, 53, "ペコリーヌ", 105801, 0, 15, 0, 80003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("2.5周年\nありがとうございます！", 303, 54, "ペコリーヌ・コッコロ・キャル", 105801, 0, 15, 0, 80003, 0, "105901,45,106001,61", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 304, 1, "カリン", 190804, 1, 0, 1, 60002, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 305, 0, "", 0, 1, 0, 2, 60002, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 306, 0, "", 0, 1, 0, 2, 60002, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 307, 0, "", 0, 1, 0, 2, 60002, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 308, 0, "", 0, 1, 0, 2, 60002, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 309, 0, "", 0, 2, 0, 2, 60002, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 310, 0, "", 0, 1, 0, 2, 60002, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 311, 0, "", 0, 1, 0, 2, 60002, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 312, 0, "", 0, 1, 0, 2, 60002, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 313, 0, "", 0, 1, 0, 2, 60002, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 314, 0, "", 0, 2, 0, 2, 60002, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 315, 0, "", 0, 1, 0, 2, 60002, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 316, 0, "", 0, 1, 0, 2, 60002, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 317, 0, "", 0, 1, 0, 2, 60002, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 318, 0, "", 0, 1, 0, 2, 60002, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 319, 0, "", 0, 1, 0, 2, 60002, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 320, 0, "", 0, 1, 0, 2, 60002, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 321, 0, "", 0, 2, 0, 2, 60002, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 322, 0, "", 0, 1, 0, 2, 60002, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 323, 0, "", 0, 1, 0, 2, 60002, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 324, 0, "", 0, 1, 0, 2, 60002, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 325, 0, "", 0, 1, 0, 2, 60002, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 326, 0, "", 0, 1, 0, 2, 60002, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 327, 0, "", 0, 1, 0, 2, 60002, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 328, 0, "", 0, 2, 0, 2, 60002, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 329, 2, "カリン", 190804, 0, 0, 3, 60002, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 330, 3, "カリン", 190804, 0, 7, 3, 60002, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ささ、シェフィさまはこちらへ…", 331, 1, "コッコロ", 105901, 0, 1, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("コッコロさん、どこへ行くの…？\n…え？", 332, 1, "シェフィ", 106401, 0, 1, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 333, 1, "ペコリーヌ", 105801, 0, 1, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 334, 2, "コッコロ", 105901, 0, 1, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ええと…\n二人とも何をしているの？", 335, 2, "シェフィ", 106401, 0, 1, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 336, 1, "キャル", 106001, 0, 1, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あの日…？", 337, 3, "シェフィ", 106401, 0, 1, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 338, 2, "ペコリーヌ", 105801, 0, 1, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", 339, 3, "ペコリーヌ", 105801, 0, 1, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("やばいですね☆", 340, 1, "カリン", 190801, 0, 1, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("って、なにしれっと\n参加してんのよカリン！", 341, 2, "キャル", 106001, 0, 1, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 342, 2, "カリン", 190801, 0, 1, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 343, 3, "カリン", 190801, 0, 1, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 344, 4, "ペコリーヌ", 105801, 0, 1, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", 345, 4, "シェフィ", 106401, 0, 1, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 346, 5, "ペコリーヌ", 105801, 0, 2, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 347, 3, "コッコロ", 105901, 0, 2, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 348, 4, "コッコロ", 105901, 0, 2, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 349, 6, "ペコリーヌ", 105801, 0, 2, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("さすがでございます\nペコリーヌさま", 350, 5, "コッコロ", 105901, 0, 2, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 351, 3, "キャル", 106001, 0, 2, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", 352, 5, "シェフィ", 106401, 0, 2, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 353, 7, "ペコリーヌ", 105801, 0, 2, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("さ、次はキャルさまの\n番でございますよ", 354, 6, "コッコロ", 105901, 0, 2, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", 355, 4, "キャル", 106001, 0, 2, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 356, 6, "シェフィ", 106401, 0, 2, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 357, 5, "キャル", 106001, 0, 2, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", 358, 6, "キャル", 106001, 0, 2, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 359, 7, "コッコロ", 105901, 0, 2, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 360, 7, "キャル", 106001, 0, 2, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 361, 8, "コッコロ", 105901, 0, 3, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 362, 8, "ペコリーヌ", 105801, 0, 3, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 363, 9, "コッコロ", 105901, 0, 3, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("聖学祭…って、なにかしら？", 364, 7, "シェフィ", 106401, 0, 3, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 365, 10, "コッコロ", 105901, 0, 3, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 366, 8, "キャル", 106001, 0, 3, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 367, 9, "キャル", 106001, 0, 3, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 368, 9, "ペコリーヌ", 105801, 0, 3, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("いや、そのまんますぎでしょ…", 369, 10, "キャル", 106001, 0, 3, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 370, 8, "シェフィ", 106401, 0, 3, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 371, 10, "ペコリーヌ", 105801, 0, 3, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えっ？　ええ…\nぎゅーっ…？", 372, 9, "シェフィ", 106401, 0, 3, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 373, 11, "キャル", 106001, 0, 4, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 374, 10, "シェフィ", 106401, 0, 4, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 375, 12, "キャル", 106001, 0, 4, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 376, 11, "コッコロ", 105901, 0, 4, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 377, 13, "キャル", 106001, 0, 4, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 378, 11, "ペコリーヌ", 105801, 0, 4, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 379, 14, "キャル", 106001, 0, 4, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 380, 15, "キャル", 106001, 0, 4, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 381, 11, "シェフィ", 106401, 0, 4, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 382, 12, "ペコリーヌ", 105801, 0, 4, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 383, 12, "コッコロ", 105901, 0, 4, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 384, 16, "キャル", 106001, 0, 4, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 385, 12, "シェフィ", 106401, 0, 4, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 386, 13, "ペコリーヌ", 105801, 0, 5, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 387, 14, "ペコリーヌ", 105801, 0, 5, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 388, 15, "ペコリーヌ", 105801, 0, 5, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 389, 17, "キャル", 106001, 0, 5, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 390, 18, "キャル", 106001, 0, 5, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 391, 13, "シェフィ", 106401, 0, 5, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 392, 13, "コッコロ", 105901, 0, 5, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 393, 16, "ペコリーヌ", 105801, 0, 5, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 394, 19, "キャル", 106001, 0, 5, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 395, 17, "ペコリーヌ", 105801, 0, 5, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 396, 18, "ペコリーヌ", 105801, 0, 5, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 397, 19, "ペコリーヌ", 105801, 0, 5, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 398, 4, "カリン", 190801, 0, 6, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 399, 5, "カリン", 190801, 0, 6, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…えっ！？", 400, 20, "キャル", 106001, 0, 6, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 401, 20, "ペコリーヌ", 105801, 0, 6, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 402, 14, "シェフィ", 106401, 0, 6, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 403, 14, "コッコロ", 105901, 0, 6, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 404, 15, "シェフィ", 106401, 0, 6, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 405, 21, "キャル", 106001, 0, 6, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 406, 21, "ペコリーヌ", 105801, 0, 6, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ぶっ殺すぞ！？", 407, 22, "キャル", 106001, 0, 6, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 408, 6, "カリン", 190801, 0, 6, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 409, 15, "コッコロ", 105901, 0, 7, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 410, 23, "キャル", 106001, 0, 7, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 411, 16, "シェフィ", 106401, 0, 7, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 412, 22, "ペコリーヌ", 105801, 0, 7, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 413, 24, "キャル", 106001, 0, 7, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 414, 17, "シェフィ", 106401, 0, 7, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 415, 16, "コッコロ", 105901, 0, 7, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 416, 18, "シェフィ", 106401, 0, 7, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", 417, 17, "コッコロ", 105901, 0, 7, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("しれっと教育ママが\n生まれてる…？", 418, 25, "キャル", 106001, 0, 7, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 419, 23, "ペコリーヌ", 105801, 0, 7, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("え～～～～！？", 420, 26, "キャル", 106001, 0, 7, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 421, 27, "キャル", 106001, 0, 8, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", 422, 19, "シェフィ", 106401, 0, 8, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 423, 18, "コッコロ", 105901, 0, 8, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 424, 24, "ペコリーヌ", 105801, 0, 8, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 425, 20, "シェフィ", 106401, 0, 8, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 426, 28, "キャル", 106001, 0, 8, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 427, 19, "コッコロ", 105901, 0, 8, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 428, 21, "シェフィ", 106401, 0, 8, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 429, 29, "キャル", 106001, 0, 8, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 430, 30, "キャル", 106001, 0, 8, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 431, 25, "ペコリーヌ", 105801, 0, 8, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 432, 31, "キャル", 106001, 0, 8, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 433, 22, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", 434, 23, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 435, 24, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 436, 25, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", 437, 26, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", 438, 27, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("―びえぇぇ～んっ！！！", 439, 28, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("どうされましたか、シェフィさま", 440, 20, "コッコロ", 105901, 0, 9, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ううっ…ひっく…\nママッ…！", 441, 29, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 442, 21, "コッコロ", 105901, 0, 9, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 443, 22, "コッコロ", 105901, 0, 9, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 444, 30, "シェフィ", 106401, 0, 9, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("主さま\n3.5周年まであと５日\nでございます", 445, 23, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ですがその前に\n生放送がありますね", 446, 24, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…生放送に向けた\n意気込みでございますか？", 447, 25, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 448, 26, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 449, 27, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 450, 28, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 451, 29, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 452, 30, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 453, 31, "コッコロ", 105901, 0, 10, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと４日！\nやばいですね☆", 454, 26, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 455, 32, "キャル", 106001, 0, 11, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 456, 27, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 457, 28, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 458, 29, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 459, 33, "キャル", 106001, 0, 11, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 460, 30, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 461, 31, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 462, 32, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("だからあたしはやるなんて一言も…", 463, 34, "キャル", 106001, 0, 11, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("オイッスー☆", 464, 33, "ペコリーヌ", 105801, 0, 11, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("聞きなさいっての！！", 465, 35, "キャル", 106001, 0, 11, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", 466, 31, "シェフィ", 106401, 0, 12, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 467, 32, "シェフィ", 106401, 0, 12, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", 468, 33, "シェフィ", 106401, 0, 12, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 469, 34, "シェフィ", 106401, 0, 12, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 470, 35, "シェフィ", 106401, 0, 12, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("やってますねシェフィちゃん！", 471, 34, "ペコリーヌ", 105801, 0, 12, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なによ、考えることは\nみんな同じってこと？", 472, 36, "キャル", 106001, 0, 12, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 473, 32, "コッコロ", 105901, 0, 12, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("みんな…もちろんよ！", 474, 36, "シェフィ", 106401, 0, 12, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 475, 35, "ペコリーヌ", 105801, 0, 12, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 476, 7, "カリン", 190801, 0, 13, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 477, 8, "カリン", 190801, 0, 13, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 478, 36, "ペコリーヌ", 105801, 0, 13, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 479, 9, "カリン", 190801, 0, 13, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 480, 33, "コッコロ", 105901, 0, 13, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", 481, 10, "カリン", 190801, 0, 13, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", 482, 37, "キャル", 106001, 0, 13, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 483, 11, "カリン", 190801, 0, 13, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あうー？", 484, 37, "シェフィ", 106401, 0, 13, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("あ…", 485, 37, "みんな", 105801, 0, 13, 4, 80005, 0, "105901,34,106001,38,190801,12", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 486, 39, "キャル", 106001, 0, 13, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 487, 35, "コッコロ", 105901, 0, 13, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 488, 38, "ペコリーヌ", 105801, 0, 13, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 489, 13, "カリン", 190801, 0, 13, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 490, 38, "シェフィ", 106401, 0, 14, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 491, 39, "ペコリーヌ", 105801, 0, 14, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 492, 40, "キャル", 106001, 0, 14, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 493, 36, "コッコロ", 105901, 0, 14, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 494, 39, "シェフィ", 106401, 0, 14, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 495, 40, "ペコリーヌ", 105801, 0, 14, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 496, 37, "コッコロ", 105901, 0, 14, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 497, 41, "キャル", 106001, 0, 14, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("へ、へぇ…", 498, 40, "シェフィ", 106401, 0, 14, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 499, 41, "ペコリーヌ", 105801, 0, 14, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 500, 41, "シェフィ", 106401, 0, 14, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 501, 42, "シェフィ", 106401, 0, 14, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 502, 42, "ペコリーヌ", 105801, 0, 15, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("祝！", 503, 42, "キャル", 106001, 0, 15, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("3.5周年！", 504, 38, "コッコロ", 105901, 0, 15, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("おめでとうございます！", 505, 43, "シェフィ", 106401, 0, 15, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 506, 14, "カリン", 190801, 0, 15, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 507, 15, "カリン", 190801, 0, 15, 2, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 508, 43, "ペコリーヌ", 105801, 0, 15, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 509, 44, "ペコリーヌ", 105801, 0, 15, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 510, 43, "キャル", 106001, 0, 15, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 511, 44, "キャル", 106001, 0, 15, 1, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 512, 44, "シェフィ", 106401, 0, 15, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 513, 45, "シェフィ", 106401, 0, 15, 0, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 514, 39, "コッコロ", 105901, 0, 15, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 515, 40, "コッコロ", 105901, 0, 15, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 516, 41, "コッコロ", 105901, 0, 15, 4, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 517, 45, "ペコリーヌ", 105801, 0, 15, 3, 80005, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("これからも\nよろしくおねがいします！", 518, 46, "みんな", 105801, 0, 15, 4, 80005, 0, "105901,42,106001,45,106401,46,190801,16", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 519, 1, "カリン", 190804, 1, 0, 1, 60003, 0, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 520, 0, "", 0, 1, 0, 2, 60003, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 521, 0, "", 0, 1, 0, 2, 60003, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 522, 0, "", 0, 1, 0, 2, 60003, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 523, 0, "", 0, 1, 0, 2, 60003, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 524, 0, "", 0, 2, 0, 2, 60003, 1, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 525, 0, "", 0, 1, 0, 2, 60003, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 526, 0, "", 0, 1, 0, 2, 60003, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 527, 0, "", 0, 1, 0, 2, 60003, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 528, 0, "", 0, 1, 0, 2, 60003, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 529, 0, "", 0, 2, 0, 2, 60003, 2, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 530, 0, "", 0, 1, 0, 2, 60003, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 531, 0, "", 0, 1, 0, 2, 60003, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 532, 0, "", 0, 1, 0, 2, 60003, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 533, 0, "", 0, 1, 0, 2, 60003, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 534, 0, "", 0, 1, 0, 2, 60003, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 535, 0, "", 0, 1, 0, 2, 60003, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 536, 0, "", 0, 2, 0, 2, 60003, 3, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 537, 0, "", 0, 1, 0, 2, 60003, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 538, 0, "", 0, 1, 0, 2, 60003, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 539, 0, "", 0, 1, 0, 2, 60003, 4, "", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES ("今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 540, 0, "", 0, 1, 0, 2, 60003, 4, "", 0);
